import {useState} from 'react'
import Example from './Example'

const Todo = () => {
  const [todosList , setTodoList] = useState([
    {
      id: 1,
      content: "店予約する",
    },
    {
      id: 2,
      content: "卵買う",
    },
    {
      id: 3,
      content: "郵便出す",
    },
  ]);
  return(
    <>
    <Example todosItem={todosList} setTodoList={setTodoList}/>
    </>
  )
};
